import logo from './logo.svg';
import './App.css';
import HelloComponent from "./Component/Hello";

function App() {
  return (
    <div className="App">
        <HelloComponent name={'Артур'}/>
        <HelloComponent name={'123'}/>
        <HelloComponent name={'Виктор'}/>
    </div>
  );
}

export default App;
